import React from "react";
import { ListGroup, ListGroupItem, Button, Row, Col } from "react-bootstrap";

const CartButton = (prop) => {
  return (
    <ListGroupItem>
      <Row>
        <Button
          className="btn-block"
          type="button"
          disabled={prop.countInStock === 0}
        >
          ADD TO CART
        </Button>
      </Row>
    </ListGroupItem>
  );
};

export default CartButton;
